import{_ as t,o as e,c as a,V as d}from"./chunks/framework.b2940161.js";const u=JSON.parse('{"title":"JEECG之菜单配置说明","description":"","frontmatter":{},"headers":[],"relativePath":"blog/Form表单不支持双向绑定，不能使用v-model？.md","filePath":"blog/Form表单不支持双向绑定，不能使用v-model？.md","lastUpdated":1689742070000}'),s={name:"blog/Form表单不支持双向绑定，不能使用v-model？.md"},l=d('<h1 id="jeecg之菜单配置说明" tabindex="-1">JEECG之菜单配置说明 <a class="header-anchor" href="#jeecg之菜单配置说明" aria-label="Permalink to &quot;JEECG之菜单配置说明&quot;">​</a></h1><table><thead><tr><th>字段名称</th><th>说明</th></tr></thead><tbody><tr><td>菜单类型</td><td>一级菜单：配置一级菜单；子菜单：配置下级菜单；按钮：配置页面按钮权限</td></tr><tr><td>菜单名称</td><td>定义菜单名称</td></tr><tr><td>上级菜单</td><td>菜单类型为子菜单时，选择关联的上级菜单</td></tr><tr><td>菜单路径</td><td>定义菜单的路径，通常为：/包名/文件名 具体参见【菜单路径配置说明】</td></tr><tr><td>前端组件</td><td>定义菜单访问的组件名称，有两种类型，一种为通用组件，一种为具体的页面，</td></tr><tr><td></td><td>具体参见【<a href="#菜单路径配置说明">前端组件配置说明</a>】</td></tr><tr><td>菜单图标</td><td>菜单树展示的图标</td></tr><tr><td>排序</td><td>菜单展示的先后顺序</td></tr><tr><td>是否路由</td><td>此处很重要，默认是路由；如果是非的话，访问404</td></tr><tr><td>隐藏路由</td><td>不展示为菜单，但是在页面中跳转，弹出的页面路由菜单</td></tr><tr><td>聚合路由</td><td>多个下级菜单路由在一个页面聚合展示</td></tr><tr><td>打开方式</td><td>内部/外部，外部只非路由请求</td></tr></tbody></table><h3 id="前端组件配置说明" tabindex="-1">前端组件配置说明： <a class="header-anchor" href="#前端组件配置说明" aria-label="Permalink to &quot;前端组件配置说明：&quot;">​</a></h3><p>1、非叶子菜单（即没有下级的菜单）<strong>配置固定</strong>前端组件 <code>layouts/RouteView</code></p><div class="language-shell line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">layouts/RouteView</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p>2、普通的叶子菜单（即具体的页面） 配置相对于<code>src/views</code>目录的路径</p><blockquote><p>例如 <code>src/views/jeecg/helloworld.vue</code> 这个页面，前端组件为 <code>jeecg/helloworld</code></p></blockquote><p><img src="https://img.kancloud.cn/fb/d1/fbd1b9e5468354e5abd8a84041ddf609_632x719.png" alt=""></p><p>3、需要跳转到第三页面的菜单 前端组件固定为：<code>layouts/IframePageView</code>，比如跳转百度：<a href="https://www.baidu.com/" target="_blank" rel="noreferrer">https://www.baidu.com</a></p><p><img src="https://img.kancloud.cn/ec/6f/ec6faaa41982a3e393f263b6c91f7c30_677x729.png" alt=""></p><p>4、java后台请求的菜单 需要以 <code>{window._CONFIG[&#39;domianURL&#39;]</code>开头</p><div class="language-shell line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">{</span><span style="color:#A6ACCD;">{{window._CONFIG[&#39;domianURL&#39;]}}</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p><img src="https://img.kancloud.cn/2c/f3/2cf35ecee57481c064120da9b4af2c8d_666x725.png" alt=""></p><p>5、配置外网打开的链接，请求地址需要以<code>http</code>开头或者<code>window._CONFIG[&#39;domianURL&#39;]</code>开头</p><div class="language-shell line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">window._CONFIG[</span><span style="color:#FFCB6B;">&#39;domianURL&#39;</span><span style="color:#FFCB6B;">]</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p><img src="https://img.kancloud.cn/d2/b0/d2b0cc9c1a5a22476511f2b64f701cfb_702x902.png" alt=""></p><h3 id="菜单路径配置说明" tabindex="-1">菜单路径配置说明 <a class="header-anchor" href="#菜单路径配置说明" aria-label="Permalink to &quot;菜单路径配置说明&quot;">​</a></h3><ul><li>1、非叶子菜单（即没有下级的菜单），URL配置规则：按照功能模块定义的关键根路径即可，不能重复，<strong>需以“/”开头</strong></li><li>2、普通的叶子菜单（即具体的页面），URL和前端组件配置保持一致即可，需在前端组件值前加“/”</li><li>3、需要跳转到第三方页面的菜单，菜单路径配置第三方跳转的地址即可，例如<a href="http://www.baidu.com" target="_blank" rel="noreferrer">http://www.baidu.com</a></li></ul>',18),o=[l];function r(n,c,i,p,h,m){return e(),a("div",null,o)}const b=t(s,[["render",r]]);export{u as __pageData,b as default};
